        position: absolute; top: 10vh; right: 50%;
    }

        width: 32vw;
        right: -47vw;
        top: 17vh;
    }
    .f .balance_zero{
        width: 21.5vw;
    top: 35vh;
    right: -42vw;
    }
    .f .speen{

        top: 43vh;

        right: -7.5vw;

    .f{

    .f img{position: absolute; }
    .f .speen{
        width: 45vw;

    }
    .f .speenn{

    @keyframes spin { from { transform: rotate(0deg); } to { transform: rotate(1755deg); } }
    @keyframes speenn { from { transform: rotate(1755deg); } to { transform: rotate(3600deg); }  }
    @keyframes spennn { from { transform: rotate(3600deg); } to { transform: rotate(5215deg); }    }
    .f .Overlay_mob{
        z-index: -1;
        opacity: 0;

        right: -50vw;
        top: -10vh;

function checkOrientation() {
    if (window.orientation === undefined) {
      console.log('Ориентация не поддерживается в данном браузере');
      return;
    }
  
    if (Math.abs(window.orientation) === 90) {
      console.log('Устройство в ландшафтной ориентации');
      Overlay_mob.style.display = 'none';
      overlay_norm.style.display = 'block';

    } else {

      overlay_norm.style.display = 'none';
      Overlay_mob.style.display = 'block';
    }
  }
